import React from "react";
import { NavLink } from 'react-router-dom';

function NavBar() {

    return (
        <>
            <div className = "topnav">
                <button><NavLink to="/sales">Sales Overview</NavLink></button>
                <button><NavLink to="/stores">Store Details</NavLink></button>
                <button><NavLink to="/products">Product Details</NavLink></button>
            </div>
        </>
    )
}

export default NavBar
